namespace App\Tests\ControllerTest;

use App\Entity\Cursus;
use App\Entity\User;
use Symfony\Bundle\FrameworkBundle\Test\WebTestCase;
use Symfony\Component\BrowserKit\Cookie;
use Symfony\Component\Security\Guard\Token\PostAuthenticationGuardToken;

class CursusControllerTest extends WebTestCase
{
    private $client = null;
    private $route;
    private $cursus;

    public function setUp()
    {
        $kernel = self::bootKernel();
        $this->client = static::createClient();
        $this->route = $kernel->getProjectDir();
        $this->logIn($this->client);

    }

    private function logIn()
    {
        $session = $this->client->getContainer()->get('session');
        $user = $this->client->getContainer()->get('doctrine')->getRepository(User::class)->findOneByEmail('admin@talan.com');
        $firewall = 'main';
        $token = new PostAuthenticationGuardToken($user, $firewall, $user->getRoles());
        $session->set('_security_' . $firewall, serialize($token));
        $session->save();
        $cookie = new Cookie($session->getName(), $session->getId());
        $this->client->getCookieJar()->set($cookie);
    }

    public function testShow()
    {
        $crawler = $this->client->request('GET', '/admin/cursus');
        $this->assertEquals(200, $this->client->getResponse()->getStatusCode());
        $this->assertEquals(1, $crawler->filter('#cursus-list')->count());

    }


    public  function testGetFormAddErrorNotHtmlRequest(){
        $crawler = $this->client->request('GET', '/admin/cursus/add/form');
        $this->assertEquals(400, $this->client->getResponse()->getStatusCode());
    }

    public  function testAddErrorNotHtmlRequest(){
        $crawler = $this->client->request('GET', '/admin/cursus/add');
        $this->assertEquals(400, $this->client->getResponse()->getStatusCode());
    }

    public function testAdd()
    {
        $imageContent='data:image/png;base64,';

        $crawler = $this->client->xmlHttpRequest('GET', '/admin/cursus/add/form');
        $form = $crawler->selectButton('ENREGISTRER')->form();
        $this->assertEquals(1, $crawler->selectButton('ENREGISTRER')->count());
        $form['cursus[name]'] = 'test cursusutrut name';
        $form['cursus[description]'] = 'test cursus description';
        $form['cursus[tags]'] = 'php mysql';
        $form['cursus[image]'] = $imageContent;
        $this->client->setServerParameters(['HTTP_X-Requested-With' => 'XMLHttpRequest', 'REQUEST_METHOD' => 'POST']);
        $this->client->submit($form);
        $this->assertEquals(201, $this->client->getResponse()->getStatusCode());
    }

    public function testAddError()
    {
        $imageContent='data:image/png;base64,';
        $crawler = $this->client->xmlHttpRequest('GET', '/admin/cursus/add/form');
        $form = $crawler->selectButton('ENREGISTRER')->form();
        $this->assertEquals(1, $crawler->selectButton('ENREGISTRER')->count());
        $form['cursus[name]'] = '';
        $form['cursus[description]'] = 'test cursus description';
        $form['cursus[tags]'] = 'php mysql';
        $form['cursus[image]'] = $imageContent;
        $this->client->setServerParameters(['HTTP_X-Requested-With' => 'XMLHttpRequest', 'REQUEST_METHOD' => 'POST']);
        $this->client->submit($form);
        $this->assertEquals(400, $this->client->getResponse()->getStatusCode());
    }

    public function testGetEditCursusForm()
    {
        $crawler = $this->client->xmlHttpRequest('GET', '/admin/cursus/2/edit');
        $this->client->setServerParameter('HTTP_X-Requested-With', 'XMLHttpRequest');
        $this->assertEquals(200, $this->client->getResponse()->getStatusCode());
        $this->assertEquals(1, $crawler->selectButton('ENREGISTRER')->count());

    }
    public function testGetEditCursusFormError()
    {
        $crawler = $this->client->request('GET', '/admin/cursus/2/edit');
        $this->assertEquals(400, $this->client->getResponse()->getStatusCode());
    }

    public function testEditCursus()
    {
        $crawler = $this->client->xmlHttpRequest('GET', '/admin/cursus/4/edit');
        $form = $crawler->selectButton('ENREGISTRER')->form();
        $form['cursus[name]'] = 'test cursus edit';
        $form['cursus[description]'] = 'test cursus edit';
        $form['cursus[tags]'] = 'test cursus edit';
        $this->client->setServerParameters(['HTTP_X-Requested-With' => 'XMLHttpRequest', 'REQUEST_METHOD' => 'POST']);
        $this->client->submit($form);
        $this->assertEquals(201, $this->client->getResponse()->getStatusCode());
    }

    public function testEditCursusVisibility()
    {
        $this->client->xmlHttpRequest('PATCH', '/admin/cursus/1/edit');
        $this->assertEquals(201, $this->client->getResponse()->getStatusCode());


    }
    public function testEditCursusVisibilityError()
    {
        $this->client->request('PATCH', '/admin/cursus/1/edit');
        $this->assertEquals(400, $this->client->getResponse()->getStatusCode());


    }

    public function testgetImageCursusError()
    {
        $this->cursus = $this->client->getContainer()->get('doctrine')->getRepository(Cursus::class)->find(21);
        $this->assertFileNotExists($this->route . DIRECTORY_SEPARATOR . 'public' . DIRECTORY_SEPARATOR . 'file_upload' . DIRECTORY_SEPARATOR . 'cursus_image' . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . $this->cursus->getImage());
        $this->client->xmlHttpRequest('GET', '/admin/cursus/4/edit');
        $this->assertEquals(200, $this->client->getResponse()->getStatusCode());
    }

    public function testgetImageCursus()
    {
        $this->cursus = $this->client->getContainer()->get('doctrine')->getRepository(Cursus::class)->find(21);
        $this->assertFileExists($this->route . DIRECTORY_SEPARATOR . 'public' . DIRECTORY_SEPARATOR . 'file_upload' . DIRECTORY_SEPARATOR . 'cursus' . DIRECTORY_SEPARATOR . $this->cursus->getImage());
        $this->client->xmlHttpRequest('GET', '/admin/cursus/4/edit');
        $this->assertEquals(200, $this->client->getResponse()->getStatusCode());
    }
}
